void OAIVoiceV1ByocTrunkApi::updateByocTrunk(const QString &sid, const ::OpenAPI::OptionalParam<bool> &cnam_lookup_enabled, const ::OpenAPI::OptionalParam<QString> &connection_policy_sid, const ::OpenAPI::OptionalParam<QString> &friendly_name, const ::OpenAPI::OptionalParam<QString> &from_domain_sid, const ::OpenAPI::OptionalParam<QString> &status_callback_method, const ::OpenAPI::OptionalParam<QString> &status_callback_url, const ::OpenAPI::OptionalParam<QString> &voice_fallback_method, const ::OpenAPI::OptionalParam<QString> &voice_fallback_url, const ::OpenAPI::OptionalParam<QString> &voice_method, const ::OpenAPI::OptionalParam<QString> &voice_url) {
    QString fullPath = QString(_serverConfigs["updateByocTrunk"][_serverIndices.value("updateByocTrunk")].URL()+"/v1/ByocTrunks/{Sid}");
    
    if (!_username.isEmpty() && !_password.isEmpty()) {
        QByteArray b64;
        b64.append(_username.toUtf8() + ":" + _password.toUtf8());
        addHeaders("Authorization","Basic " + b64.toBase64());
    }
    
    {
        QString sidPathParam("{");
        sidPathParam.append("Sid").append("}");
        QString pathPrefix, pathSuffix, pathDelimiter;
        QString pathStyle = "simple";
        if (pathStyle == "")
            pathStyle = "simple";
        pathPrefix = getParamStylePrefix(pathStyle);
        pathSuffix = getParamStyleSuffix(pathStyle);
        pathDelimiter = getParamStyleDelimiter(pathStyle, "Sid", false);
        QString paramString = (pathStyle == "matrix") ? pathPrefix+"Sid"+pathSuffix : pathPrefix;
        fullPath.replace(sidPathParam, paramString+QUrl::toPercentEncoding(::OpenAPI::toStringValue(sid)));
    }
    OAIHttpRequestWorker *worker = new OAIHttpRequestWorker(this, _manager);
    worker->setTimeOut(_timeOut);
    worker->setWorkingDirectory(_workingDirectory);
    OAIHttpRequestInput input(fullPath, "POST");

    if (cnam_lookup_enabled.hasValue())
    {
        input.add_var("CnamLookupEnabled", ::OpenAPI::toStringValue(cnam_lookup_enabled.value()));
    }
    if (connection_policy_sid.hasValue())
    {
        input.add_var("ConnectionPolicySid", ::OpenAPI::toStringValue(connection_policy_sid.value()));
    }
    if (friendly_name.hasValue())
    {
        input.add_var("FriendlyName", ::OpenAPI::toStringValue(friendly_name.value()));
    }
    if (from_domain_sid.hasValue())
    {
        input.add_var("FromDomainSid", ::OpenAPI::toStringValue(from_domain_sid.value()));
    }
    if (status_callback_method.hasValue())
    {
        input.add_var("StatusCallbackMethod", ::OpenAPI::toStringValue(status_callback_method.value()));
    }
    if (status_callback_url.hasValue())
    {
        input.add_var("StatusCallbackUrl", ::OpenAPI::toStringValue(status_callback_url.value()));
    }
    if (voice_fallback_method.hasValue())
    {
        input.add_var("VoiceFallbackMethod", ::OpenAPI::toStringValue(voice_fallback_method.value()));
    }
    if (voice_fallback_url.hasValue())
    {
        input.add_var("VoiceFallbackUrl", ::OpenAPI::toStringValue(voice_fallback_url.value()));
    }
    if (voice_method.hasValue())
    {
        input.add_var("VoiceMethod", ::OpenAPI::toStringValue(voice_method.value()));
    }
    if (voice_url.hasValue())
    {
        input.add_var("VoiceUrl", ::OpenAPI::toStringValue(voice_url.value()));
    }

    for (auto keyValueIt = _defaultHeaders.keyValueBegin(); keyValueIt != _defaultHeaders.keyValueEnd(); keyValueIt++) {
        input.headers.insert(keyValueIt->first, keyValueIt->second);
    }


    connect(worker, &OAIHttpRequestWorker::on_execution_finished, this, &OAIVoiceV1ByocTrunkApi::updateByocTrunkCallback);
    connect(this, &OAIVoiceV1ByocTrunkApi::abortRequestsSignal, worker, &QObject::deleteLater);
    connect(worker, &QObject::destroyed, this, [this]() {
        if (findChildren<OAIHttpRequestWorker*>().count() == 0) {
            Q_EMIT allPendingRequestsCompleted();
        }
    });

    worker->execute(&input);
}

void OAIVoiceV1ByocTrunkApi::updateByocTrunkCallback(OAIHttpRequestWorker *worker) {
    QString error_str = worker->error_str;
    QNetworkReply::NetworkError error_type = worker->error_type;

    if (worker->error_type != QNetworkReply::NoError) {
        error_str = QString("%1, %2").arg(worker->error_str, QString(worker->response));
    }
    OAIVoice_v1_byoc_trunk output(QString(worker->response));
    worker->deleteLater();

    if (worker->error_type == QNetworkReply::NoError) {
        Q_EMIT updateByocTrunkSignal(output);
        Q_EMIT updateByocTrunkSignalFull(worker, output);
    } else {

#if defined(_MSC_VER)
// For MSVC
#pragma warning(push)
#pragma warning(disable : 4996)
#elif defined(__clang__)
// For Clang
#pragma clang diagnostic push
#pragma clang diagnostic ignored "-Wdeprecated-declarations"
#elif defined(__GNUC__)
// For GCC
#pragma GCC diagnostic push
#pragma GCC diagnostic ignored "-Wdeprecated-declarations"
#endif

        Q_EMIT updateByocTrunkSignalE(output, error_type, error_str);
        Q_EMIT updateByocTrunkSignalEFull(worker, error_type, error_str);

#if defined(_MSC_VER)
#pragma warning(pop)
#elif defined(__clang__)
#pragma clang diagnostic pop
#elif defined(__GNUC__)
#pragma GCC diagnostic pop
#endif

        Q_EMIT updateByocTrunkSignalError(output, error_type, error_str);
        Q_EMIT updateByocTrunkSignalErrorFull(worker, error_type, error_str);
    }
}

void OAIVoiceV1ByocTrunkApi::tokenAvailable(){

    oauthToken token;
    switch (_OauthMethod) {
    case 1: //implicit flow
        token = _implicitFlow.getToken(_latestScope.join(" "));
        if(token.isValid()){
            _latestInput.headers.insert("Authorization", "Bearer " + token.getToken());
            _latestWorker->execute(&_latestInput);
        }else{
            _implicitFlow.removeToken(_latestScope.join(" "));
            qDebug() << "Could not retrieve a valid token";
        }
        break;
    case 2: //authorization flow
        token = _authFlow.getToken(_latestScope.join(" "));
        if(token.isValid()){
            _latestInput.headers.insert("Authorization", "Bearer " + token.getToken());
            _latestWorker->execute(&_latestInput);
        }else{
            _authFlow.removeToken(_latestScope.join(" "));
            qDebug() << "Could not retrieve a valid token";
        }
        break;
    case 3: //client credentials flow
        token = _credentialFlow.getToken(_latestScope.join(" "));
        if(token.isValid()){
            _latestInput.headers.insert("Authorization", "Bearer " + token.getToken());
            _latestWorker->execute(&_latestInput);
        }else{
            _credentialFlow.removeToken(_latestScope.join(" "));
            qDebug() << "Could not retrieve a valid token";
        }
        break;
    case 4: //resource owner password flow
        token = _passwordFlow.getToken(_latestScope.join(" "));
        if(token.isValid()){
            _latestInput.headers.insert("Authorization", "Bearer " + token.getToken());
            _latestWorker->execute(&_latestInput);
        }else{
            _credentialFlow.removeToken(_latestScope.join(" "));
            qDebug() << "Could not retrieve a valid token";
        }
        break;
    default:
        qDebug() << "No Oauth method set!";
        break;
    }
}
